import React from 'react'

function Row(props){
    return(
        <div>
            <tr>
        <td>
          <img src={props.imageURL} alt="" />
        </td>
        <td>{props.name}</td>

        <td>{props.email}</td>
        <td>{props.DOB.date.split("-")[1] + "-" + props.DOB.date.split("-")[2].slice(0,2) + "-" + props.DOB.date.split("-")[0]}</td>
      </tr>
        </div>
    )
}

export default Row;
